import React from 'react';
import { withRouter } from 'react-router';
import "./men"
import { MenuItemContainer,
    BackgroundImageContainer,
    ContentContainer,
    ContentTitle,
    ContentSubtitle } from "./menuitem.styled"

export default withRouter(function Menuitems({title ,imageUrl , size , linkUrl , history , match}) {
    return (
        <MenuItemContainer small={size} onClick={ () => history.push(`${match.url}${linkUrl}`)}>
        <BackgroundImageContainer style={{ 
    background : `url(${imageUrl})`}} />
          <div className='content'>
           <h1 className='title'>{title.toUpperCase()}</h1>
           <span className='subtitle'>Shop Now</span>
          </div>
        </MenuItemContainer>
    )
})
